package com.example.weather.repository;import lombok.Getter;import lombok.Setter;import javax.persistence.Column;import javax.persistence.Entity;import javax.persistence.Table;@Entity@Table(name = "wind")@Getter@Setterpublic class WindEntity extends BaseEntity {    @Column(name = "wind_ref_Id")    public void setRefId(Long refId) {        super.setRefId(refId);    }    @Column    private double speed;    @Column    private int deg;}